create table raffle_user_records
(
    id            int unsigned auto_increment
        primary key,
    activity_id   int unsigned                           not null comment '活动id',
    record_id     int unsigned                           not null comment '组团记录id',
    user_id       int unsigned                           not null comment '用户id',
    ticket_points int unsigned                           not null comment '抽奖券分值',
    status        int unsigned default 0                 not null comment '中奖状态,0:未中奖,1:中奖',
    created_at    datetime     default CURRENT_TIMESTAMP not null,
    updated_at    datetime                               null
)
    collate = utf8mb4_unicode_ci;

